export async function getUsedMarket() {
  // API 호출을 위한 fetch 사용
  const response = await fetch("https://panda-market-api.vercel.app/products");

  // 응답의 JSON 데이터 추출
  const body = await response.json();

  // 데이터 반환
  return body;
}
